	 ('5a9cef78e4ba436f81fdb752df855920','5','aa428946184940fd91ed903e6791b095','35ab16199319476d8ca1d97aac2eece7','kesplus_workflow','current_user','pkg_wf_engine_definiton','CREATE OR REPLACE PACKAGE "kesplus_workflow"."pkg_wf_engine_definiton" AUTHID CURRENT_USER AS
    /**
     * 根据流程定义Id获取流程定义
     *
     */
    FUNCTION get_process_defintion_by_process_def_id(processDefId varchar) RETURNS jsonb;
    /**
     * 根据流程实例Id获取流程定义
     *
     */
    FUNCTION get_process_defintion_by_proc_inst_id(v_proc_inst_id varchar) RETURNS jsonb ;
    /**
     * 根据流程定义Key获取流程定义
     *
     */
    FUNCTION get_process_defintion_by_process_def_key(processDefKey varchar,tenantId varchar) RETURNS jsonb ;
    FUNCTION get_process_defintion_by_modeler_id(v_modeler_id varchar) RETURNS jsonb;
    /**
     * 根据taskId获取当前环节的下一环节信息
     * @taskId:当前待办Id
     * @variable：流程变量
     * return 下一环节的信息
     */
    FUNCTION get_next_task_def(taskId varchar, variable JSON) RETURNS jsonb;
   
    /**
     * 根据当前环节定义Key获取环节的信息
     */
    FUNCTION get_task_def_by_task_def_key(process JSONB, currentTaskDefKey varchar) RETURNS JSONB;
    FUNCTION get_task_def_by_task_def_key(processDefId varchar, currentTaskDefKey varchar) RETURNS JSONB;
    
    /*判断当前流程是否是引用的子流程*/
    FUNCTION get_ref_ru_execution(v_task_id varchar) RETURNS jsonb;
    
    FUNCTION get_bpmn_process(v_main_process_instance_id varchar) RETURNS jsonb;
    /**
     * 根据已办的Id获取当前环节之前环节的流程扩展信息
     */
    FUNCTION get_all_prev_task_def(taskId varchar) RETURNS jsonb;
    
    FUNCTION get_prev_task_def(v_task_id varchar) RETURNS jsonb;
     
    /*获取活动execution数*/
    FUNCTION get_variable_in_parallel_gateway(v_task_id varchar,v_process_instance_id varchar,v_task_def json)  RETURNS jsonb;
  
   
    
    FUNCTION get_submit_type_with_parallel_user_sign (v_task_id varchar,v_flow_content jsonb,v_variable json) RETURNS jsonb ;
    FUNCTION do_rule_with_parallel_user_sign (v_cur_submit_agree_count int,v_cur_submit_dis_agree_count int,v_element_rule TEXT,v_element_rule_proportion TEXT,v_op_type varchar) RETURNS int;
    FUNCTION get_variable_with_parallel_user_sign (v_task_id varchar,v_flow_content jsonb,v_variable json) RETURNS jsonb;
    
    FUNCTION is_exists_in_assignee(v_assignee JSON,v_user_id varchar) RETURNS boolean;
    /*获取流程变量*/
    FUNCTION get_variable_by_process_instance_id(v_process_instance_id varchar,v_task_def_key varchar) RETURNS jsonb;
    FUNCTION get_variable_by_task_id(v_task_id varchar) RETURNS jsonb;
    FUNCTION get_variable2_by_task_id(v_process_instance_id varchar,v_task_def_key varchar) RETURNS jsonb ;
    FUNCTION get_variable2_by_task_id(v_task_id varchar) RETURNS jsonb ;
    /*获取过滤过权限的节点定义信息*/
    FUNCTION get_element_def_with_btn(cur_element jsonb) RETURNS jsonb;
    FUNCTION get_process_variables_with_btn(process_variables JSON,v_process_status varchar) RETURNS jsonb;
    
    FUNCTION get_assignee_by_task_id(v_task_id varchar) RETURNS jsonb;
    FUNCTION get_his_assignee_by_task_id(v_task_id varchar) RETURNS jsonb ;
    FUNCTION get_assignee(v_task_id varchar,v_element_type varchar,v_cur_user_id varchar) RETURNS jsonb;
    
    
     /**
     * 获取主流程开始节点信息
     * @v_process：流程定义
     * return 开始节点信息
     */
    FUNCTION get_start_element(v_process JSONB) RETURNS JSONB;
    FUNCTION get_start_element(v_process JSONB,v_process_id varchar) RETURNS JSONB;
    /**
     * 获取主流程结束节点信息
     * @v_process：流程定义
     * return 开始节点信息
     */
    FUNCTION get_end_element(v_process JSONB) RETURNS JSONB;
    FUNCTION get_end_element(v_process JSONB,v_process_id varchar) RETURNS JSONB;
    /**
     * 通过连线的前节点标识获取连线信息标识(如果存在多个连线，则抛出异常)
     * @process_elements：流程节点列表信息
     * @v_variable：流程变量
     * @v_prev_element_id：连线的前节点标识
     * return 连线信息标识(如果存在多个连线，则抛出异常)
     */
    FUNCTION get_sequence_flow_id(v_flow_content jsonb,v_variable json,v_prev_element_id TEXT) RETURN TEXT;
    /**
     * 通过连线的前后节点标识获取连线信息(一个连线)
     * @process_elements：流程节点列表信息
     * @current_element_def_key：连线的前节点标识
     * @current_element_def_key：连线的后节点标识
     * return 连线信息(一个连线)
     */
    FUNCTION get_sequence_flow(process_elements JSONB, prev_element_def_key varchar, next_element_def_key varchar) RETURNS JSONB;
    /**
     * 通过连线的前节点标识和后续节点标识获取连线信息(一个连线)
     * @v_flow_content：流程节点列表信息
     * @from_element_def_key：连线的前节点标识
     * @to_element_def_key：连线的后后续节点标识(与连线可能不相邻)
     * return 连线信息(一个连线)
     */
    FUNCTION get_sequence_flow_from_to(v_flow_content JSONB, from_element_def_key varchar, to_element_def_key varchar) RETURNS JSONB;
   
    PROCEDURE get_leaf_element(v_flow_content JSONB, v_start_element_def_key varchar,v_ret_json IN OUT JSONB)   ;
    
    PROCEDURE check_leaf_element(v_process JSONB);
    PROCEDURE check_subprocess_nesting(v_bpmn_xml XML);
     /**
     * 获取流程节点列表信息
     * @v_process：流程定义
     * return 流程节点列表信息
     */
    FUNCTION get_process_elements(process JSONB) RETURNS JSONB;
    FUNCTION get_process_elements(process_elements JSONB, v_process_id varchar) RETURNS JSONB;
     /**
     * 通过节点标识获取下一节点信息(一个或者多个节点)
     * @process_elements：流程节点列表信息
     * @variable：流程变量
     * @current_element_def_key：节点标识
     * return 获取下一节点信息(一个或者多个节点)
     */
    FUNCTION get_next_element(process_elements JSONB, variable JSON, current_element_def_key varchar) RETURNS JSONB ;
     /**
     * 通过节点标识获取当前节点信息(一个节点)
     * @process_elements：流程节点列表信息
     * @current_element_def_key：节点标识
     * return 当前节点信息(一个节点)
     */
    FUNCTION get_current_element(process_elements JSONB,current_element_def_key varchar) RETURNS JSONB;
     
END;','CREATE OR REPLACE PACKAGE BODY "kesplus_workflow"."pkg_wf_engine_definiton" AS WRAPPED
