	 ('652212610f4040e2905776c9942cc0f1','5','aa428946184940fd91ed903e6791b095','35ab16199319476d8ca1d97aac2eece7','kesplus_workflow','current_user','pkg_wf_engine_history','CREATE OR REPLACE PACKAGE "kesplus_workflow"."pkg_wf_engine_history" AUTHID CURRENT_USER AS
    /*撤销流程*/
	PROCEDURE retract_process(v_process_instance_id varchar, v_reason varchar , v_ret OUT jsonb);
	/*终止流程*/
	PROCEDURE termination_process(v_process_instance_id varchar, v_reason varchar , v_ret OUT jsonb);
	/*挂起流程*/
	PROCEDURE suspend_process(v_process_instance_id varchar, v_reason varchar , v_ret OUT jsonb);
	/*恢复流程*/
	PROCEDURE activate_process(v_process_instance_id varchar, v_reason varchar , v_ret OUT jsonb);
	/*催办流程*/
	PROCEDURE press_todo_process(v_process_instance_id varchar, v_reason varchar , v_ret OUT jsonb);
	
	/*撤回*/
    FUNCTION retract_task(taskOpId varchar,reason varchar) RETURN JSON;
    FUNCTION view_message(v_task_op_id varchar) RETURN JSON ;
	/*退回到开始节点*/
	PROCEDURE reject_first_task(v_process_instance_id varchar, v_reason varchar ,  v_flow_content jsonb,v_variable json, v_ret_value OUT json);
	/*退回*/
	PROCEDURE reject_task(v_curr_task_op_id varchar,v_prev_task_op_id varchar, v_flow_content jsonb,v_variable json, v_ret_value OUT json) ;
	/*转办*/
	PROCEDURE transfer_task(v_flow_content jsonb ,v_variable jsonb, ret_value OUT json);
	
	/*委托*/
	PROCEDURE delegate_task(v_flow_content jsonb ,v_variable json, ret_value OUT json);
	
	/*前加签*/
	PROCEDURE pre_add_user_task(v_flow_content jsonb ,v_variable json, ret_value OUT json);
	
	/*后加签*/
	PROCEDURE after_add_user_task(v_flow_content jsonb ,v_variable json, ret_value OUT json);
	
	/*加签*/
	PROCEDURE add_user_task(v_flow_content jsonb ,v_variable json, ret_value OUT json);
	
	/*减签*/
	PROCEDURE remove_user_task(v_flow_content jsonb ,v_variable json, ret_value OUT json);
	
	/*知会*/
	PROCEDURE cc_message(v_flow_content jsonb ,v_variable jsonb, ret_value OUT json);
	
	/*通知*/
	PROCEDURE notice_message(v_flow_content jsonb ,v_variable jsonb, ret_value OUT json);
