	 ('950ab8051a2042768933ff614716569b','5','aa428946184940fd91ed903e6791b095','35ab16199319476d8ca1d97aac2eece7','kesplus_workflow','current_user','pkg_wf_engine_instance','CREATE OR REPLACE PACKAGE "kesplus_workflow"."pkg_wf_engine_instance" AUTHID CURRENT_USER AS
	 /**
	 * @Description 流程预启动
	 * @param v_process_def_key : 流程定义Key
	 * @param v_starter：流程发起人
	 * @param v_tenant_id ： 流程发起人租户Id
	 * @param v_flow_content ： 流程上下文
	 * @param v_variable :流程变量
	 * @param v_ret_value 流程预启动执行后的返回值
	 */
	PROCEDURE flow_process_mock_start(v_process_def_key varchar,v_starter varchar , v_tenant_id varchar ,v_flow_content JSONB,v_variable JSON ,v_ret_value OUT JSON);
	/**
	 * @Description 流程预提交
	 * @param v_task_id : 当前待办Id
	 * @param v_flow_content ： 流程上下文
	 * @param v_variable :流程变量
	 * @param v_ret_value 流程预提交执行后的返回值
	 */
	PROCEDURE flow_process_mock_execute(v_task_id varchar,v_flow_content JSONB,v_variable JSON ,v_ret_value OUT JSON);
	/**
	 * @Description 流程启动执行
	 * @param v_process_def_key : 流程定义Key
	 * @param v_starter：流程发起人
	 * @param v_tenant_id ： 租户Id
	 * @param v_flow_content ： 流程上下文
	 * @param v_variable :流程变量
	 * @param v_ret_value 流程启动执行后的返回值
	 */
    PROCEDURE flow_process_start(v_process_def_key varchar,v_starter varchar , v_tenant_id varchar ,v_flow_content JSONB,v_variable JSON ,v_ret_value OUT JSON);
	/**
	 * @Description 流程处理执行
	 * @param v_current_task_id : 当前待办Id
	 * @param v_next_task_def_key： 提交到下一个环节
	 * @param v_flow_content ： 流程上下文
	 * @param v_variable :流程变量
	 * @param v_ret_value 流程处理执行后的返回值
	 */
	PROCEDURE flow_process_execute(v_current_task_id varchar, v_next_task_def_key varchar, v_flow_content JSONB, v_variable JSON,v_ret_value OUT jsonb);
	
