	 ('ec549f63b27f4cb581d7489b5884d541','5','aa428946184940fd91ed903e6791b095','35ab16199319476d8ca1d97aac2eece7','kesplus_workflow','current_user','pkg_wf_engine_utils','CREATE OR REPLACE PACKAGE "kesplus_workflow"."pkg_wf_engine_utils" AUTHID CURRENT_USER AS
	FUNCTION hash_code(value TEXT) RETURNS integer;
	/**
	 * @Description 计算分支线条件表达式
	 * @param seqflow 分支线数据
	 * @param variable 表达式的变量值
	 * @Return boolean 表达式计算结果 true/false
	 */
	FUNCTION calculateBranchCondition(seqflow jsonb, variable JSON) RETURNS boolean;
	/**
	 * @Description 表达式计算
	 * @param expr 需要计算的表达式,eg:({money} > 100 AND {money} <=1000) AND {contractType} = 1
	 * @param variable 表达式的变量值,eg：{"money":400,"contractType":1}
	 * @Return boolean 表达式计算结果 true/false
	 */
	FUNCTION calculateExpr(expr TEXT, variable JSON) RETURNS boolean;
	/**
	 * @Description 表达式占位处理
	 * @param expr 需要计算的表达式,eg:({money} > 100 AND {money} <=1000) AND {contractType} = 1
	 * @param variable 表达式的变量值,eg：{"money":400,"contractType":1}
	 * @Return TEXT 占位替换后的表达式
	 */
	FUNCTION getExpr(expr varchar,variable json) RETURN TEXT;
	/**
	 * @Description 表达式计算
	 * @param expr 需要计算的表达式,eg:({money} > 100 AND {money} <=1000) AND {contractType} = 1
	 * @param variable 表达式的变量值,eg：{"money":400,"contractType":1}
	 * @Return boolean 表达式计算结果 true/false
	 */
	FUNCTION executeExpr(expr varchar,variable json) RETURNS boolean;
	
	FUNCTION execute_plsql_expression(v_expr varchar,v_variable json) RETURNS json ;
	/**
	 * @Description 判断指定人json数组assignee中是否存在具体指定人user_id
	 * @param v_assignee 指定人json数组
	 * @param v_user_id 具体指定人user_id
	 * @Return boolean  true/false
	 */
	FUNCTION is_exists_in_assignee(v_assignee JSON,v_user_id varchar) RETURNS boolean;
	
	FUNCTION is_exists_in_assignee(v_assignee JSON,v_other_assignee JSON) RETURNS boolean;
	/**
	 * @Description 从指定人json数组assignee截取形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_start_index 开始索引
	 * @param v_end_index 结束索引
	 * @Return JSON  新的json数组
	 */
	FUNCTION slice_in_assignee(v_assignee JSON,v_start_index int,v_end_index int) RETURNS JSON;
	
		/**
	 * @Description 从指定人json数组assignee删除形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_user_id 要删除的具体指定人user_id
	 * @Return JSON  新的json数组
	 */
	FUNCTION remove_in_assignee(v_assignee JSON,v_user_id varchar) RETURNS JSON;
	
		/**
	 * @Description 从指定人json数组assignee删除对应json数组assignee形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_remove_assignee 要删除的json数组
	 * @Return JSON  新的json数组
	 */
	FUNCTION remove_in_assignee(v_assignee JSON,v_remove_assignee JSON) RETURNS JSON;
	/**
	 * @Description 从指定人json数组assignee替换形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_old_user_id 旧的具体指定人user_id
	 * @param v_new_user_id 新的具体指定人user_id
	 * @Return JSON  新的json数组
	 */
	FUNCTION replace_in_assignee(v_assignee JSON,v_old_user_id varchar,v_new_user_id varchar) RETURNS JSON;
	/**
	 * @Description 从指定人json数组assignee当前具体指定人user_id之前插入形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_cur_user_id 当前的具体指定人user_id
	 * @param v_insert_user_id 要插入的具体指定人user_id
	 * @Return JSON  新的json数组
	 */
	FUNCTION insert_before_in_assignee(v_assignee JSON,v_cur_user_id varchar,v_insert_user_id varchar) RETURNS JSON ;
	
	/**
	 * @Description 从指定人json数组assignee当前具体指定人user_id之插入形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_cur_user_id 当前的具体指定人user_id
	 * @param v_insert_user_id 要插入的具体指定人user_id
	 * @Return JSON  新的json数组
	 */
	FUNCTION insert_after_in_assignee(v_assignee JSON,v_cur_user_id varchar,v_insert_user_id varchar) RETURNS JSON;
	
	/**
	 * @Description 从指定人json数组assignee插入形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_insert_user_id 要插入的具体指定人user_id
	 * @Return JSON  新的json数组
	 */
	FUNCTION insert_in_assignee(v_assignee JSON,v_insert_user_id varchar) RETURNS JSON;
	
	/**
	 * @Description 从指定人json数组assignee插入形成新的json数组
	 * @param v_assignee 指定人json数组
	 * @param v_insert_assignee 要插入的列表
	 * @Return JSON  新的json数组
	 */
	FUNCTION insert_in_assignee(v_assignee JSON,v_insert_assignee JSON) RETURNS JSON;
	
	/**
	 * @Description 从指定人json数组assignee查找具体指定人
	 * @param v_assignee 指定人json数组
	 * @param v_user_id 要查找的具体指定人user_id
	 * @Return JSON  具体指定人
	 */
	FUNCTION get_in_assignee(v_assignee JSON,v_user_id varchar) RETURNS JSON;
	
	/**
	 * @Description 从节点json数组1过滤掉节点json数组2
	 * @param v_bpmn_process_flows 节点json数组1
	 * @param v_bpmn_task_flows 节点json数组2
	 * @Return JSON  json数据
	 */
	FUNCTION get_flows(v_bpmn_process_flows JSON,v_bpmn_task_flows JSON) RETURNS JSON;
	FUNCTION get_flows_by_process_instance_id(v_process_instance_id varchar,v_process JSONb) RETURNS json;
	FUNCTION get_flows_from_to(v_from_element_id varchar,v_to_element_id varchar,v_process JSONb) RETURNS json ;
	/**
	 * @Description 获取流程变量及对应值
	 * @param v_process_variables : 流程变量
	 * @param v_variables：流程变量值
	 * @param ret 流程变量及对应值
	 */
	FUNCTION get_process_variables(v_process_variables JSONb,v_variables JSONb) RETURN jsonb ;
	
	FUNCTION remove_empty_strings(json_obj JSONB) RETURNS JSONB;
