	 * 优先通过processInstanceId流程实例id获取当前实例的详细定义信息(返回base64的xml数据)
	 * 最低通过processDefId流程定义id获取当前实例的详细定义信息(返回base64的xml数据)
	 * @param processInstanceId 流程实例id
	 * @param processDefId 流程定义id
	 * RETURN 返回base64的xml数据
	 */
	FUNCTION get_process_bpmn(processInstanceId varchar, processDefId varchar)RETURN TEXT;
	/**
	 * restful-api接口实现
	 * @Description 获取流程操作记录
	 * @param processInstanceId 流程实例id
	 * RETURN 返回流程操作记录
	 */
	FUNCTION get_process_detail(processInstanceId varchar)RETURN JSON;
	/**
     * restful-api接口实现/starter/page
	 * @Description 分页查询我发起的流程列表
	 * @param jsonData : 查询条件
	 * RETURN 返回我发起的流程列表表
	 */
	FUNCTION page_by_starter(jsonData TEXT) RETURN JSON;
	/**
	 * restful-api接口实现
	 * @Description 流程图
	 * @param processInstanceId : 查询条件
	 * RETURN 流程图
	 */
	FUNCTION get_process_instance_flows(processInstanceId varchar) RETURN jsonb;
	/**
	 * 记录流程启动的操作过程
	 * 		可能会包括流程的创建、任务的创建
	 * @param process 流程相关信息
	 * @return 记录结果
	 */
    FUNCTION save_process(process JSON,variables jsonb) RETURN varchar;
  
    /**
	 * @Description 流程开始
	 * @param v_process 流程
	 * @param v_res 返回值
	 */
	PROCEDURE process_start(v_process JSON, v_res OUT json);
	/**
	 * @Description 流程结束
	 * @param v_process_instance_id 流程id
	 * @param v_process_def_id 流程定义id
	 * @param v_task_def_key 结束节点定义id
	 * @param v_task_name 结束节点定义name
	 * @param v_flow 流程节点
	 */
	PROCEDURE process_end(v_process_instance_id varchar, v_process_def_id varchar,v_task_def_key varchar,v_task_name varchar,v_flow jsonb);
	
	PROCEDURE process_mark(process JSON,resTaskInfo OUT json);
	/**
	 * 任务创建
	 * @param process 流程
	 * @param hasRetract 是否支持撤回
	 * @param resTaskInfo 返回值
	 */
	PROCEDURE task_create(v_process JSON,v_has_retract int, v_res OUT json);
	/**
	 * 任务完成
	 * @param taskId 任务id
	 * @param task 任务信息
	 * @param res 返回值
	 */
	PROCEDURE task_complete(v_task_id varchar, v_process JSON, v_res OUT json);
	/**
	 * 任务撤回
	 * @param v_task_id 任务id
	 * @param v_process 任务信息
	 * @param v_res 返回值
	 */
	PROCEDURE task_retract(v_task_id varchar, v_process JSON, v_res OUT json);
	
	/**
	 * 任务退回
	 * @param taskId 任务id
	 * @param task 任务信息
	 * @param res 返回值
	 */
	PROCEDURE task_reject(v_task_id varchar, v_process JSON, v_res OUT json);
	
	/**
	 * 任务销毁
	 * @param taskId 任务id
	 * @param variables 任务信息
	 * @param res 返回值
	 */
    PROCEDURE task_destruction(v_task_id varchar, v_variables JSON, v_res OUT json);
	
	FUNCTION save_process_draft(variables jsonb) RETURN varchar;
	
	/**
	 * 生成流程待办
	 * @param taskInfo 用户审批节点信息
	 * @param variables 参数/变量
	 * @param roleCheck 业务表单是否需要进行角色授权
	 */
	PROCEDURE send_pending_task(v_todo_pending_info JSON, v_variables JSON, v_role_check boolean DEFAULT FALSE);
	PROCEDURE send_pending_message(v_task_info JSON, v_variables JSON, v_role_check boolean DEFAULT FALSE);
	
	FUNCTION get_result_text(v_result varchar) RETURN varchar ;
	
	_TASK_RES_REJECT INT := 0;
	_TASK_RES_PASS INT := 1;
